INSERT INTO `brands` (`id`, `name`, `description`, `phone`, `notice`, `bank`, `image`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Hoàng Long', 'Nhà xe Hoàng Long\r\nNhằm hướng tới cung cấp thông tin đặt vé và tư vấn đặt chỗ các nhà xe khách tốt nhất.\r\nHãng xe Hoàng Long hay còn gọi là Hoàng Long Asia hoặc Hoàng Long Bus là một trong những thương hiệu xe chất lượng cao hàng đầu Việt Nam. Xe giường nằm cao cấp Hoàng Long liên tục cải tiến với rất nhiều tiện ích như TV, máy lạnh, khăn lạnh, nhà vệ sinh,... giúp hành khách trên xe luôn cảm giác thoải mái. Tuyến đường chính của hãng xe là Sài Gòn - Hà Nội. Trên địa bàn các tỉnh thành khác, xe có hỗ trợ dừng tại văn phòng các tỉnh trên quốc lộ 1A.\r\nLoại xe Hoàng Long đi Hà Nội hỗ trợ tốt về chất lượng giường nằm người đi. Vì là xe giường nằmi lớn nên xe có hỗ trợ hành khách chở thêm hàng hóa. Tuy nhiên, hành khách cần liên hệ trực tiếp nhà xe khi có hàng hóa mang theo để được sắp xếp và chừa cốp.', '[\"0398669765\"]', NULL, '[\"VCB - 152121569870\"]', '/images/brands/1594746848.hl1.jpeg', 1, '2020-07-12 15:28:00', '2020-07-15 00:14:08'),
(2, 'Nhà xe Phúc Xuyên', 'Nhằm tạo điều kiện thuận lợi cho du khách khi đi du lịch vịnh Hạ Long có thể lựa chọn cho mình nhà xe chất lượng tốt nhất. Chúng tôi giới thiệu các bến xe có các nhà xe chạy tuyến Hà Nội đi Hạ Long phục vụ du khách tham quan vịnh Hạ Long. Một số bến xe nổi tiếng có xe đi Hạ Long ở Hà Nội như: Bến xe Mỹ Đình, Bến xe Giáp Bát, Bến xe Gia lâm.', '[\"0966646280\"]', NULL, '[\"VCB - 152121569870\"]', '/images/brands/1594746774.px1.jpg', 1, '2020-07-13 12:29:02', '2020-07-15 00:12:54'),
(3, 'Xuân Hòa', 'Nhà xe Xuân Hòa chuyên xe khách .\r\n Hệ thống đặt vé trực truyến và cổng thông tin vé xe khách. Bạn có thể dễ dàng so sánh bảng giá vé, lịch trình, số điện thoại, địa chỉ cũng như đánh giá về các hãng xe. Công ty vận tải Giang Tuấn nhằm phục vụ lợi ích chung của cộng đồng. Các thông tin trên web đã được kiểm chứng, tuy nhiên có thể thay đổi. Do vậy khách hàng cần liên hệ với nhà xe theo số diện thoại. Các nhà xe muốn cung cấp thông tin tuyến xe trên web vui lòng liên hệ đến số điện thoại của công ty.', '[\"0362767565\"]', NULL, '[\"VCB - 152121276582\"]', '/images/brands/1594746682.xh1.jpg', 1, '2020-07-13 12:36:12', '2020-07-15 00:11:22'),
(4, 'Nhà xe Hải Âu', 'Là doanh nghiệp hoạt động trong lĩnh vực vận tải hành khách đường bộ và chuyển phát hàng hóa với thương hiệu Xe khách Hải Âu. Trải qua gần 20 năm hình thành, xây dựng và phát triển, đến nay, chúng tôi tự hào được phục vụ hàng chục triệu lượt khách hàng trên 6 tỉnh, thành phố:\r\nHải Phòng – Hải Dương – Hưng Yên – Hà Nội – Thái Bình – Nam Định\r\nHình ảnh xe khách Hải Âu trong sắc xanh thanh nhã cùng hình tượng cánh chim hải âu phóng khoáng đã trở nên quen thuộc và luôn được ưu tiên lựa chọn hàng đầu của khách hàng trong các tỉnh miền Bắc. Với sự quan tâm và tin tưởng đó, Hải Âu luôn không ngừng nỗ lực nâng cao chất lượng phục vụ, trang bị phương tiện và cơ sở hạ tầng hiện đại, đào tạo đội ngũ nhân viên chuyên nghiệp, thân thiện nhằm đem đến trải nghiệm thoải mái nhất cho khách hàng.', '[\"0398667462\"]', NULL, '[\"VCB - 152127569821\"]', '/images/brands/1594746582.ha1.jpeg', 1, '2020-07-13 12:40:43', '2020-07-15 00:09:42'),
(5, 'Nhà xe Hoàng Hà', 'Xe khách Hoàng Hà :\r\nLà một thành phố trẻ, Thái Bình đang ngày càng phát triển đặc biệt chú trọng vào dịch vụ vận tải. Công ty Cổ phần Hoàng Hà ra đời nhằm mục đích hiện đại hóa và đa dạng hóa loại hình vận tải, góp phần mang đến sự di chuyển thuận lợi hơn cho du khách gần xa. Nhà xe Hoàng Hà được thành lập theo giấy chứng nhận đăng ký kinh doanh số 1000272301 do Sở Kế hoạch và Đầu tư Thái Bình cấp ngày 25/9/2001. Hãng xe khách Hoàng Hà có thế mạnh phục vụ vận tải hành khách trên các tuyến cố định, theo hợp đồng. Với hệ thống phương tiện sang trọng, lịch sự, an toàn và hoạt động ổn định, hãng xe Hoàng Hà mang đến sự thoải mái cho khách hàng có nhu cầu đi lại', '[\"02256759361\"]', NULL, '[\"VietinBank - 82174867856\"]', '/images/brands/1594746420.hh3.jpeg', 1, '2020-07-14 09:29:53', '2020-07-15 00:07:00');
